import React from "react";
export const NotFound = () => {
  return (
    <div className="p-20 bg-404 bg-cover h-screen bg-blend-lighten mx-auto">
      {/* <h1 className="text-9xl font-bodyFont font-extrabold text-transparent shadow-2xl drop-shadow-2xl w-fit backdrop-blur-md bg-clip-text"> */}
      <div className="flex flex-col justify-between items-center w-fit gap-10 mx-auto">
        <div className="flex border-separate border rounded-full flex-col justify-center items-center w-fit">
          <h1 className="text-9xl backdrop-blur-md font-bodyFont font-extrabold text-white shadow-black drop-shadow-2xl">
            404 Error !
          </h1>
        </div>
        {/* <span className="text-[12rem] font-bodyFont w-fit font-extrabold text-white drop-shadow-2xl shadow-green-400">
          :
        </span> */}
        <div className="backdrop-blur w-fit text-8xl text-center font-extrabold text-white drop-shadow-2xl shadow-black">
          Fashion Emergency
        </div>
      </div>
    </div>
  );
};
